import "./App.css";

function App() {
  return (
    <div>
      <img
        className="background"
        src="./images/portfolio-bg-01.svg"
        alt="background"
      />
      <img className="tipito" src="./images/webdev.svg" alt="tipito" />
      <h1>santo pendejo</h1>
    </div>
  );
}

export default App;
